function checkvalue(val)
{
    if(val==="pick")
       document.getElementById('todo').style.display='block';
    else
       document.getElementById('todo').style.display='none';
}  
$(document).ready(function(){
    function getTextWidth(txt) {
        var $elm = $('<span class="temp-for-size">'+txt+'</span>').prependTo("body");
        var elmWidth = $elm.width();
        $elm.remove();
        return elmWidth;
    }
    function centerSelect($elm) {
        var optionWidth = getTextWidth($elm.children(":selected").html())
        var emptySpace =   $elm.width() - optionWidth;
        var indentDivider = 2;
        var indentOffset = 15;
        var indentLengthFinal = 0;

        if (navigator.vendor == "") {
            indentDivider = 4;
            indentOffset = optionWidth / 19;
        }

        if (emptySpace / 2 > 30){
            indentLengthFinal = emptySpace/indentDivider - indentOffset;
        }

        $elm.css("text-indent", indentLengthFinal);
    }

    $('.select-field-text-category').each(function(){
        centerSelect($(this));
    });

    $('.select-field-text-category').on('change', function(){
        centerSelect($(this));
    });

    $('img[data-src]').ll();
    $('nav#cssmenu').mm({
       title: "Menu",
       format: "multitoggle"
    });
    $('.slider').slick({
        dots: false,
        infinite: true,
        speed: 1000,
        fade: true,
        autoplay: true,
        autoplaySpeed: 6000,
        arrows: false
    });
    $('.multiple-items').slick({
        infinite: true,
        slidesToShow: 5,
        slidesToScroll: 1,
        arrows: true,
        dots: true,
        responsive: [{
            breakpoint: 1024,
            settings: {
                slidesToShow: 3,
                infinite: true,
                arrows: true
            }
        }, {
            breakpoint: 600,
            settings: {
                slidesToShow: 2,
                dots: true,
                arrows: false,
            }
        }, {
            breakpoint: 300,
            settings: "unslick" // destroys slick

        }]
    });      
    $('#articleform').submit(function( event ) {
        var editor_content = quill.container.innerHTML;
        $('input[name=text]').val(editor_content);
    });
    $('.open-tab').click(function (event) {
        var tab = $(this).attr('href');
        $('#tabs').tabs('select', tab);
        return false;
    });
    window.sr = new scrollEffects();
    $("a[rel^='box']").colorbox();
    $('#password').pass({
        element: $('#passwdStrength')
    });
    $('.datepicker').datepicker({
	    multidate: true
	});
    if($(".js-range-slider").length > 0) {
        $(".js-range-slider").ionRangeSlider({
            type: "double",
            min: 0,
            max: 1000,
            from: 10,
            to: 180,
            step: 10,
            skin: "round",
            grid: false,
            prefix: "$",
            postfix: '.00'
        });
        $(".js-distance-slider").ionRangeSlider({
            min: 5,
            max: 100,
            from: 5,
            step: 5,
            skin: "round",
            grid: false,
            postfix: ' miles'
        });
    }

    $('.tipN').tooltip({placement: 'top', fade: true, html:true});
    $('.tipS').tooltip({placement: 'bottom', fade: true, html:true});
    $('.tipW').tooltip({placement: 'right', fade: true, html:true});
    $('.tipE').tooltip({placement: 'left', fade: true, html:true});
    $('.thumb-area-img').on('click', function(){
        $('.product_image img').attr('src', $(this).attr('href')); 
        return false;
    });
    $(".inline").colorbox({
    	inline: true,
		width: 600,
        height: 400,
		onOpen: function() {
            $('#preview').removeClass('d-none');
        },onClosed:function() { 
            $('#preview').addClass('d-none');
        }        
    });
    $('form.validate-form').each(function() {
        $(this).validate({
            ignore: ':hidden',
            focusInvalid: false,
            submitHandler: function(form) {
                $(form).find(':submit').prop('disabled', true).button('loading');
                form.submit();
            },
            invalidHandler: function(form, validator) {
                var errors = validator.numberOfInvalids();
                if (errors) {
                    alert({ title: 'ERROR', html: true, timer: 3000, text: 'There are some errors on the provided information. Please check it and try again.<br />All errors has being <b style="color: red;">highlighted</b> for easier recognition.'});
                    $(form).find(':submit').prop('disabled',false);
                    return false;
                }
            }
        });
    });
    $('.frame').on('click', function(){
        var url = $(this).attr('href');
        $.colorbox({
            title: ($(this).data('original-title') ? $(this).data('original-title') : $(this).data('title')),
            href: url,
            iframe: true,
            width: ($(this).data('width') ? $(this).data('width') : 500),
            height: ($(this).data('height') ? $(this).data('height') : 500),
            onOpen: function() {
                $('body').css('overflow', 'hidden');
            },onClosed:function() { 
                $('body').css('overflow', 'auto'); 
            },onComplete: function(){
                $('.cancel').click(function(){
                    $.colorbox.close();
                    return false;
                });
                if('#message-text' !== undefined){
                    $('#message-text').focus();
                }
            }
        });
        return false;
    });
    $('.popup').on('click', function(){
        var url = $(this).attr('href');
        $.colorbox({
            title: ($(this).attr('data-original-title') ? $(this).attr('data-original-title') : $(this).attr('title')),
            href: url,
            overlayClose: false,
            onOpen: function() {
                $('body').css('overflow', 'hidden');
            },onClosed:function() { 
                $('body').css('overflow', 'auto'); 
            },onComplete: function(){
                $('.cancel').click(function(){
                    $.colorbox.close();
                    return false;
                });
                if('#message-text' !== undefined){
                    $('#message-text').focus();
                }
            }
        });
        return false;
    });
    $('.window').on('click', function(){
        var url = $(this).attr('href');
        $.colorbox({
            title: ($(this).attr('data-original-title') ? $(this).attr('data-original-title') : $(this).attr('title')),
            href: url,
            onOpen: function() {
                $('body').css('overflow', 'hidden');
            },onClosed:function() { 
                $('body').css('overflow', 'auto'); 
            },onComplete: function(){
                $('.cancel').click(function(){
                    $.colorbox.close();
                    return false;
                });
                if('#message-text' !== undefined){
                    $('#message-text').focus();
                }
            }
        });
        return false;
    });
    $('.popup-form').on('click', function(){
        var url             = $(this).attr('href');
        $.colorbox({
            title: ($(this).attr('data-original-title') ? $(this).attr('data-original-title') : $(this).attr('title')),
            width: 600,
            href: url,
            onOpen: function() {
                $('body').css('overflow', 'hidden');
            },onClosed:function() { 
                $('body').css('overflow', 'auto'); 
            },onComplete: function(){
                $.colorbox.resize();
                $('.cancel').click(function(){
                    $.colorbox.close();
                    return false;
                });
                $('form').on('submit', function(){
                    $('.alert-error').hide();
                    $.ajax({
                        type: "POST",
                        url: $(this).attr('action'),
                        data: $(this).serialize(),
                        success: function (a) {
                            if($.isEmptyObject(a))
                            {
                                location.href = window.location.href;
                            }
                            else if (a.answer == 'error') 
                            {
                                alert({title: 'ERROR', html: true, timer: 3000, text: a.message});
                            } 
                            else
                            {
                                alert({title: 'SUCCESS', html: true, timer: 3000, confirmButtonColor: "#598f2c", text: a.message});
                                setTimeout(function(){
                                    $.colorbox.close();
                                }, 2000);
                            }
                        }
                    });
                    return false;
                });
            }
        });
        return false;
    });
    $('form.save').on('submit', function(){
        var form = $(this);
        form.find('button').prop('disabled', true);
        var error = form.find('.alert-error');
        var success = form.find('.alert-success');
        var hide_element = form.data('element');
        error.hide();
        success.hide();
        $.ajax({
            type: "POST",
            url: $(this).attr('action'),
            data: $(this).serialize(),
            success: function (a) {
                if($.isEmptyObject(a))
                {
                    location.href = window.location.href;
                }
                else if (a.answer == 'error') 
                {
                    error.text(a.message).removeClass('hide').show();
                    form.find('button').prop('disabled', false);
                }
                else
                {
                    success.text(a.message).removeClass('hide').show();
                    if(a.clear)
                    {
                        form.trigger('reset');
                    }
                    setTimeout(function(){
                        success.hide();
                        if(hide_element != null)
                        {
                            $(hide_element).slideUp();
                        }
                    }, 2000);
                }
            }
        });
        return false;
    });
    $('a.confirm').on('click', function(){
        var url             = $(this).attr('href');
        var main_parent     = $(this).attr('data-parent');
        alert({
            title: ($(this).attr('data-original-title') ? $(this).attr('data-original-title') : $(this).attr('title')),
            text: ($(this).attr('data-desc') ? $(this).attr('data-desc') : 'Are you sure you want to proceed with this action?'),
            type: "warning",
            showCancelButton: true,
            confirmButtonColor: "#DD6B55",
            confirmButtonText: "OK"
        }, function(){
            $.ajax({
                url: url,
                type: "get",
                dataType: "json",
                success: function (a) {
                    if($.isEmptyObject(a))
                    {
                        location.href = window.location.href;
                    }
                    else if (a.answer == 'error') 
                    {
                        alert({title: 'ERROR', timer: 3000, text: a.message});
                    } 
                    else
                    {
                        if(main_parent !== undefined)
                        {
                            $('#' + main_parent).css('background-color', '#FFB3B3').fadeOut('slow');
                        }
                        else
                        {
                            setTimeout(function(){
                                alert({title: 'Success', html: true, timer: 3000, text: a.message});
                            }, 100);
                        }
                    }
                }
            });
        });
        return false;
    });
    $('.deletion').on('click', function(){
        var url = $(this).attr('href');
        var main_parent = (typeof $(this).data('main-parent') !== 'undefined' ? $('#' + $(this).data('main-parent')) : $(this).parent().parent());
        alert({
            title: 'Confirm Deletion',
            text: (typeof $(this).data('message') !== 'undefined' ? $(this).data('message') : 'Are you sure you want to delete this item?'),
            type: 'warning',
            showCancelButton: true,
            confirmButtonColor: '#DD6B55',
            confirmButtonText: 'OK'
        }, function(){
            $.ajax({
                url: url,
                type: "get",
                dataType: "json",
                cache: true,
                crossDomain: true,
                success: function (a) {
                    if (a.answer == 'error') 
                    {
                        $('#cboxLoadedContent').text(a.message);
                    } 
                    else 
                    {
                        main_parent.css('background-color', '#FFB3B3').fadeOut('slow');
                    }
                }
            });
        });
        return false;
    });
    $('a.remove-item-from-cart').on('click', function() {
        var url = $(this).prop('href');
        alert({
            title: 'Confirm Deletion',
            text: 'Are you sure you want to ERASE this item from the shopping cart?',
            type: "warning",
            showCancelButton: true,
            confirmButtonColor: "#DD6B55",
            confirmButtonText: "OK"
        }, function(){
            $('body').addClass('loading');
            location.href = url;
        });
        return false;
    });
    $('a.terminal_print_receipt').on('click', function() {
        window.open($(this).prop('href'), 'print_receipt', 'width=840, height=700, resizable=1');
        return false;
    });
    $('.country').on('change', function(){
        var state_field_name = $(this).parent().parent().parent().find('.state').attr('name');
        var state_field_class = $(this).parent().parent().parent().find('.state').attr('class');
        var state_element_area = $(this).parent().parent().parent().find('.state').parent();
        $.get('pages/load_states/?name=' + state_field_name +'&country=' + this.value + '&class='+ state_field_class, function(data){
            $(state_element_area).html(data);
        });
    });
    $('#share-buttons').share({networks: ['facebook','twitter','googleplus','pinterest','linkedin','stumbleupon'], theme: 'square'});
    // $('.price-field, .discount-field').on('blur', function() {
    //     var value = $(this).val();
    //     value = isNaN(value) || value === '' || value === null ? 0.00 : value;
    //     $(this).val(accounting.formatMoney(parseFloat(value).toFixed(2)));
    // });
    $('.number-field').on('blur', function() {
        var value = $(this).val();
        value = isNaN(value) || value === '' || value === null ? 0 : value;
        $(this).val(accounting.formatNumber(parseFloat(value).toFixed(0)));
    });
    $('input.qty-area').on('click', function(){
        $(this).select();
    });
    $('input.qty-area').on('change', function(){
        var id = $(this).attr('data-item-id');
        var qty = $(this).val();
        if($('#paypal_qty_' + id).length > 0) {
            $('#paypal_qty_' + id).val(qty);
        }
        $.getJSON('orders/change_qty/?id=' + id + '/&qty=' + qty, function(json){
            $('#' + id + '_total').html(json.item_total);
            $('#sub-total-area').html(json.total);
            $('#estimated-total-area').html(json.estimated);
        });
    });
    $("#back-top").hide();
    $(window).scroll(function () {
        if($(this).scrollTop() > 100) {
            $('#back-top').fadeIn(); 
        } else {
            $('#back-top').fadeOut();
        }
    });
    $('#back-top a').click(function () {
        $('body,html').animate({
            scrollTop: 0
        }, 800);
        return false;
    });
    $('ul.tabs li a').on('click', function(){
        var href = $(this).attr('href');
        $('.tab-content').hide();
        $('.tab-container').children(href).show();
        $(this).parent().parent().find('li.active').removeClass('active');
        $(this).parent().addClass('active');
        return false;
    });
    $.colorbox.settings.maxWidth  = '95%';
    $.colorbox.settings.maxHeight = '95%';
    var resizeTimer;
    function resizeColorBox() {
        if (resizeTimer) clearTimeout(resizeTimer);
        resizeTimer = setTimeout(function() {
            if ($('#cboxOverlay').is(':visible')) {
                $.colorbox.load(true);
            }
        }, 300);
    }
    $(window).resize(resizeColorBox);
    window.addEventListener("orientationchange", resizeColorBox, false);
    jQuery.fn.scrollTo = function(elem, speed) { 
        $(this).animate({
            scrollTop:  $(this).scrollTop() - $(this).offset().top + $(elem).offset().top 
        }, speed == undefined ? 1000 : speed); 
        return this; 
    };
    if($('.loader-area').length){
        $('.loader-area').each(function(index,value){
            var url = $(value).data('url');
            var temp = $(value).data('temp');
            $.getJSON(url,function(data){
                if(!$.isEmptyObject(data)){
                    Tempo.prepare(temp).render(data);
                    $(value).show();
                }
            });
        });
    }
    $('<input>').attr({type: 'hidden',name: 'token',value: token}).appendTo('form');
    // THIS IS HONEYPOT: IF VALUE IS NOT EMPTY WE'll LIKELY BLOCK THE POST
    $('<input>').attr({type: 'hidden',name: 'honey',value: ''}).appendTo('form');

    $(document).ajaxStop(function(){
        $("img[data-src]").ll();
    });

    var full_loaded = false;
    $(window).on('scroll', function() {
        var way_down = ($(document).height() - $(window).height()) * 2 / 3;
        if ($(window).scrollTop() >= way_down){
            if(full_loaded == false && $('div#infinite-content').length >0){
                full_loaded = true;
                var query = ($('div#infinite-content').data('url').indexOf('?') == -1) ? '?' : '&';
                $.get($('div#infinite-content').data('url') + query + 's=' + $('#loader-area li').length, function(a){
                    if(!$.isEmptyObject(a)) {
                        $('#loader-area').append(a);
                        full_loaded = false;
                    } else {
                        full_loaded = true;
                        $('div#infinite-content').remove(); 
                    }
                });
            }
        }
    });
    if (("standalone" in window.navigator) && window.navigator.standalone) {
        $('a').on('click', function(e){
            e.preventDefault();
            var new_location = $(this).attr('href');
            if (new_location != undefined && new_location.substr(0, 1) != '#' && $(this).attr('target') != '_blank' && !$(this).hasClass('frame') && !$(this).hasClass('popup') && !$(this).hasClass('window') && !$(this).hasClass('popup-form') && !$(this).hasClass('confirm') && !$(this).hasClass('deletion')){
                window.location = new_location;
            }
        });
    }
    if($('.templ-info').length){
        $(".templ-info").each(function(e, t){
            var n = $(t).data("url");
            var r = $(t).data("templ");
            $.getJSON(n, function(e){
                if(!$.isEmptyObject(e)){
                    Tempo.prepare(r).render(e);
                    $(t).removeClass('hide');
                }
            });
        });
    }

    
});
